import React, { Component } from 'react';

class NavMenu extends Component {

  render() {
    return (
        <div>
         <nav class="navegator">
  <ul class="navegator-list">
    <li><a href="#">Link</a></li>
  </ul>

  <p class="navegator-end">Some text</p>
</nav> 
      </div>
    );
  }
}

export default NavMenu;
